features.script:
const rotation= feature.get('rotation')

let open = false

feature.on('click',e=>{
  if(open){  
    let y = rotation[1]+3.14/2
    feature.set({rotation:[rotation[0],y,rotation[2]]})    
  }else{
    feature.set({rotation:rotation})
  }
  open = !open
})

AFRAME.registerComponent('rotation', {
  init: function () {
    this.el.setAttribute('rotation', '0 0 0');
    this.rotateImage();
  },
  rotateImage: function () {
    let rotationSpeed = 0.2; // Adjust the speed of rotation here

    setInterval(() => {
      let currentRotation = this.el.getAttribute('rotation');
      let newYRotation = currentRotation.y + rotationSpeed;
      this.el.setAttribute('rotation', `0 ${newYRotation} 0`);
    }, 10); // Adjust the interval time for smoother or faster rotation
  }
});

